class SaveHandler {

  constructor(context) {
    this.context = context;
  }

  saveDocument({editorSession}) {
    return new Promise((resolve) => {
      let exporter = this.context.exporter;
      let doc = editorSession.getDocument();
      let dom = doc.toXML();
      let result = exporter.export(dom);
      if (result.hasErrored) {
        console.error(result.errors);
        throw new Error('Could not export JATS document')
      }
      console.info(result.dom.getNativeElement());
      // let xml = result.dom.serialize()
      resolve();
    })
  }
}

// left side: node type
// right side: ref-type
const REF_TYPES = {
  'fig': 'fig',
  'repro-fig': 'fig',
  'fig-group': 'fig',
  'fn': 'fn',
  'ref': 'bibr',
  'table-wrap': 'table',
  'table-wrap-group': 'table'
};

// TODO: how could this be configured?
const RefTypeToManager = {
  'bibr': 'referenceManager',
  'fig': 'figureManager',
  'table': 'tableManager',
  'fn': 'footnoteManager'
};

// left side: ref-type
// right side: [... node types]
const XREF_TARGET_TYPES = Object.keys(REF_TYPES).reduce((m, type) => {
  const refType = REF_TYPES[type];
  if (!m[refType]) m[refType] = [];
  m[refType].push(type);
  return m
}, {});

function getXrefTargets(xref) {
  let idrefs = xref.getAttribute('rid');
  if (idrefs) {
    return idrefs.split(' ')
  } else {
    return []
  }
}

function getXrefLabel(xref) {
  // Note: we will store the label in the node state
  // when we generate it
  if (xref.state && xref.state.label) {
    return xref.state.label
  }
  // otherwise we take the text content or an empty string
  return xref.textContent || ' '
}

function getXrefResourceManager(xref, context) {
  let managerName = RefTypeToManager[xref.getAttribute('ref-type')];
  if (managerName) {
    return context[managerName]
  }
}

function hasAvailableXrefTargets(refType, context) {
  let managerName = RefTypeToManager[refType];
  if (managerName) {
    const manager = context[managerName];
    const nodes = manager.getAvailableResources();
    return nodes.length > 0
  }

  return false
}

/*
  Computes available targets for a given xref node
  that the user can choose from.

  This implementation is very much tailored for the requirements
  in the UI, being a selection dialog.

  ```
  [
    {
      selected: true,
      node: TARGET_NODE
    }
    ,...
  ]
  ```
*/
function getAvailableXrefTargets(xref, context) {
  let manager = getXrefResourceManager(xref, context);
  if (!manager) return []
  let selectedTargets= getXrefTargets(xref);
  // retrieve all possible nodes that this
  // xref could potentially point to,
  // so that we can let the user select from a list.
  let nodes = manager.getAvailableResources();
  // Determine broken targets (such that don't exist in the document)
  let brokenTargets = substance.without(selectedTargets, ...nodes.map(r => r.id));
  let targets = nodes.map((node) => {
    // ATTENTION: targets are not just nodes
    // but entries with some information
    return {
      selected: substance.includes(selectedTargets, node.id),
      node: node,
      id: node.id
    }
  });

  targets = brokenTargets.map(id => {
    return { selected: true, node: undefined, id }
  }).concat(targets);

  // Makes the selected targets go to top
  targets = substance.orderBy(targets, ['selected'], ['desc']);
  return targets
}

class AbstractWriter extends substance.AbstractEditor {

  constructor(...args) {
    super(...args);

    this.handleActions({
      'tocEntrySelected': this.tocEntrySelected
    });
  }

  _initialize(...args) {
    // TODO: re-factor AbstractEditor w.r.t. to how managers and such are maintained.
    // ATM many of these are owned by the EditorSession, which we want to change.
    // Instead EditorSession should really only be about document and selections, and changes.
    // Other managers such as SurfaceManager could be independent.
    // The main goal would be to pull state and flow onto application level.
    // For legacy and maybe other reasons, EditorSession could be still used as a proxy for the application flow.
    super._initialize(...args);

    let editorSession = this.getEditorSession();
    let doc = editorSession.getDocument();

    this.exporter = this._getExporter();
    this.tocProvider = this._getTOCProvider();
    this.saveHandler = this._getSaveHandler();
    this.contentHighlights = new substance.Highlights(doc);

    editorSession.setSaveHandler(this.saveHandler);
  }

  didMount() {
    super.didMount();
    this.getEditorSession().onUpdate(this._onSessionUpdate, this);
  }

  dispose() {
    super.dispose();
    this.getEditorSession().off(this);
  }

  getChildContext() {
    let childContext = super.getChildContext.apply(this, arguments);
    childContext.tocProvider = this.tocProvider;
    childContext.labelGenerator = this.labelGenerator;
    return childContext
  }

  _renderToolbar($$) {
    let configurator = this.getConfigurator();
    return $$('div').addClass('se-toolbar-wrapper').append(
      $$(substance.Toolbar, {
        toolPanel: configurator.getToolPanel('toolbar')
      }).ref('toolbar')
    )
  }

  _renderContentPanel($$) { // eslint-disable-line
    throw new Error("This method is abstract.")
  }

  tocEntrySelected(nodeId) {
    return this._scrollTo(nodeId)
  }

  _scrollTo(nodeId) { // eslint-disable-line
    throw new Error("This method is abstract.")
  }

  _getExporter() {
    throw new Error("This method is abstract.")
  }

  _getTOCProvider() {
    throw new Error("This method is abstract.")
  }

  _getSaveHandler() {
    return new SaveHandler({
      documentId: this.props.documentId,
      xmlStore: this.context.xmlStore,
      exporter: this.exporter
    })
  }

  _onSessionUpdate(editorSession) {
    if (!editorSession.hasChanged('document') && !editorSession.hasChanged('selection')) return

    let sel = editorSession.getSelection();
    let selectionState = editorSession.getSelectionState();
    let xrefs = selectionState.getAnnotationsForType('xref');
    let highlights = {
      'fig': [],
      'bibr': []
    };
    if (xrefs.length === 1 && xrefs[0].getSelection().equals(sel) ) {
      let xref = xrefs[0];
      let targets = getXrefTargets(xref);
      highlights[xref.referenceType] = targets.concat([xref.id]);
    }
    this.contentHighlights.set(highlights);
  }
}

/*
  TODO: discuss

  There is a sophisticated cross-referencing package for latex
  that we took as inspiration: http://mirror.easyname.at/ctan/macros/latex/contrib/cleveref/cleveref.pdf

  This generator needs a set of configurations:

  - name: e.g. 'Figure'
  - plural: e.g. 'Figures'
  - and: e.g, ", ", or " and "
  - to: e.g, "--", or " to "
  - template: outer template, e.g. "[$]" could be used to generate "[1-3,4]"
  - groupTemplate: inner template, e.g. "[$]" could be used to generate "[1-3],[4]"

*/
const HYPHEN = '';

class NumberedLabelGenerator {
  constructor(config = {}) {
    // for labels with a type name such as 'Figure 1'
    this.name = config.name;
    // for labels with type name, with multiple refs, such as 'Figures 1-3'
    this.plural = config.plural;
    // used to join found groups
    this.and = config.and || ',';
    // used to render a single group
    this.to = config.to || HYPHEN;
    // a string where '$' will be replaced
    // this can be used to wrap the generated string,
    // e.g. "[$]" could be used to generate "[1-3,4]"
    this.template = config.template;
    // a string where '$' will be replaced
    // e.g "[$]" could be used to generate "[1-3],[4]"
    this.groupTemplate = config.groupTemplate;
    this.invalid = config.invalid || '???';
  }

  getLabel(numbers) {
    if (!numbers) return this.invalid
    if (!substance.isArray(numbers)) numbers = [numbers];
    if (numbers.length === 0) return this.invalid

    const L = numbers.length;
    numbers.sort();

    let frags = [];
    if (this.name) {
      if (L === 1) {
        frags.push(this.name);
      } else {
        frags.push(this.plural || this.name);
      }
      frags.push(' ');
    }

    // detect groups such as [1,2,3], [6], [8,9]
    let groups = [];
    let group = null;
    const _pushBlock = (g) => {
      if (!substance.isArray(g)) g = [g];
      let str;
      if (g.length === 1) {
        str = String(g[0]);
      } else if (g.length === 2) {
        _pushBlock(g[0]);
        _pushBlock(g[1]);
        return
      } else {
        // join with the 'to' operator, i.e. [1,2,3] => "1 to 3"
        str = String(g[0])+this.to+String(substance.last(g));
      }
      if (this.groupTemplate) {
        str = this.groupTemplate.slice(0).replace('$', str);
      }
      groups.push(str);
    };
    for (let i = 0; i < L; i++) {
      let n = numbers[i];
      if (n === numbers[i-1]+1) {
        group.push(n);
      } else {
        if (group) {
          _pushBlock(group);
        }
        group = [n];
      }
    }
    _pushBlock(group);

    // join all groups with the 'and' operator
    // such as ["1-3", "5"] => "1-3, 4"
    frags.push(groups.join(this.and));

    let res = frags.join('');
    if (this.template) {
      res = this.template.slice(0).replace('$', res);
    }
    return res
  }
}

function updateEntityChildArray(tx, nodeId, tagName, attribute, oldEntityIds, newEntityIds) {

  let node = tx.get(nodeId);
  let addedEntityIds = substance.without(newEntityIds, ...oldEntityIds);
  let removedEntityIds = substance.without(oldEntityIds, ...newEntityIds);

  // Remove old entities
  removedEntityIds.forEach(entityId => {
    let entityRefNode = node.find(`${tagName}[${attribute}=${entityId}]`);
    node.removeChild(entityRefNode);
    // Remove it completely
    tx.delete(entityRefNode.id);
  });

  // Create new entities
  addedEntityIds.forEach(entityId => {
    let entityRefNode = node.find(`${tagName}[${attribute}=${entityId}]`);
    if (!entityRefNode) {
      let opts = {};
      if (attribute === 'id') {
        opts = { id: entityId };
      }
      entityRefNode = tx.createElement(tagName, opts);
      if (attribute !== 'id') {
        entityRefNode.setAttribute(attribute, entityId);
      }
    }
    node.appendChild(entityRefNode);
  });

  // Sort entities in order of newEntityIds array
  let map = {};
  let refs = tx.findAll(`${tagName}`);
  refs.forEach(ref => {
    const rid = ref.getAttribute('rid');
    map[rid] = ref;
  });
  node.children.forEach(child => {
    node.removeChild(child);
  });
  newEntityIds.forEach(entityId => {
    node.appendChild(map[entityId]);
  });

  tx.setSelection(null);
}

class AbstractCitationManager {

  constructor(editorSession, type, labelGenerator) {
    this.editorSession = editorSession;

    if(!this.editorSession) {
      throw new Error("'editorSession' is mandatory.")
    }

    this.type = type;
    this.labelGenerator = labelGenerator;

    this.editorSession.onUpdate('document', this._onDocumentChange, this);
  }

  dispose() {
    this.editorSession.off(this);
  }

  _onDocumentChange(change) {
    const doc = this.editorSession.getDocument();

    // updateCitationLabels whenever
    // I.   an xref[ref-type='bibr'] is created or deleted
    // II.  the ref-type attribute of an xref is set to 'bibr' (creation)
    // II. the rid attribute of an xref with ref-type bibr is updated
    const ops = change.ops;
    let needsUpdate = false;
    for (var i = 0; i < ops.length; i++) {
      let op = ops[i];
      switch (op.type) {
        // I. citation is created or deleted
        case 'delete':
        case 'create': {
          if (op.val.type === 'xref' && op.val.attributes && op.val.attributes['ref-type'] === this.type) {
            needsUpdate = true;
          }
          break
        }
        case 'set': {
          if (op.path[1] === 'attributes') {
            // II. citation has been created, i.e. ref-type has been set to 'bibr' (or vice versa)
            if (op.path[2] === 'ref-type' && (op.val === this.type || op.original === this.type)) {
              needsUpdate = true;
            }
            // III. the references of a citation have been updated
            else if (op.path[2] === 'rid') {
              let node = doc.get(op.path[0]);
              if (node && node.getAttribute('ref-type') === this.type) {
                needsUpdate = true;
              }
            }
          }

          break
        }
        default:
          //
      }
      if (needsUpdate) break
    }
    if (needsUpdate) {
      // we should not do this in a flow
      // TODO: we need the ability to update the node state
      // either triggering a new flow, but also during a running flow
      setTimeout(() => {
        this._updateLabels();
      });
    }
  }

  /*
    Label of bibliographic entries are determined
    by the order of their citations in the document.
    I.e. typically you pick all citations (`<xref>`) as they
    occur in the document, and provide the ids of the entries
    they refer to. This forms a list of tuples, such as:
    ```
      [
        { id: 'cite1', refs: [AB06, Mac10] },
        { id: 'cite2', refs: [FW15] },
        { id: 'cite3', refs: [Mac10, AB06, AB07] }
      ]
    ```

    @param {Array<Object>} a list of citation entries.
  */
  _updateLabels() {
    const editorSession = this.editorSession;

    let xrefs = this._getXrefs();
    let refs = this._getReferences();
    let bibEl = this._getBibliographyElement();
    let refsById = refs.reduce((m, ref) => {
      m[ref.id] = ref;
      return m
    }, {});

    let pos = 1;
    let order = {};
    let refLabels = {};
    let xrefLabels = {};
    xrefs.forEach((xref) => {
      let isInvalid = false;
      let numbers = [];
      let rids = xref.getAttribute('rid') || '';
      rids = rids.split(' ');
      for (let i = 0; i < rids.length; i++) {
        const id = rids[i];
        // skip if id empty
        if (!id) continue
        // fail if there is an unknown id
        if (!refsById[id]) {
          isInvalid = true;
          continue
        }
        if (!order.hasOwnProperty(id)) {
          order[id] = pos;
          refLabels[id] = this.labelGenerator.getLabel(pos);
          pos++;
        }
        numbers.push(order[id]);
      }
      // invalid labels shall be the same as empty ones
      if (isInvalid) {
        // HACK: we just signal invalid references with a ?
        numbers.push('?');
        console.warn('invalid label detected for ', xref.toXML().getNativeElement());
      }
      xrefLabels[xref.id] = this.labelGenerator.getLabel(numbers);
    });

    // Now update the node state of all affected xref[ref-type='bibr']
    // TODO: we need a node state API
    // provided via editor session
    let change = new substance.DocumentChange([], {}, {});
    change._extractInformation();
    xrefs.forEach((xref) => {
      const label = xrefLabels[xref.id];
      if (!xref.state) {
        xref.state = {};
      }
      xref.state.label = label;
      change.updated[xref.id] = true;
    });
    refs.forEach((ref, index) => {
      const label = refLabels[ref.id];
      if (!ref.state) {
        ref.state = {};
      }
      ref.state.label = label || '';
      if (order[ref.id]) {
        ref.state.pos = order[ref.id];
      } else {
        ref.state.pos = pos + index;
      }
      change.updated[ref.id] = true;
    });

    if (bibEl) {
      // Note: also mimick a change to ref-list
      // to trigger an update
      change.updated[bibEl.id] = true;
    }

    editorSession._setDirty('document');
    editorSession._change = change;
    editorSession._info = {};
    editorSession.startFlow();
  }

  _getXrefs() {
    return this.editorSession.getDocument().findAll(`xref[ref-type='${this.type}']`)
  }

  _getBibliographyElement() {
  }

}

class ReferenceManager extends AbstractCitationManager {

  constructor(context) {
    super(context.editorSession, 'bibr', context.labelGenerator);

    this.pubMetaDbSession = context.pubMetaDbSession;
    if(!this.pubMetaDbSession) {
      throw new Error("'pubMetaDbSession' is mandatory.")
    }
    // compute initial labels
    this._updateLabels();
  }

  updateReferences(newRefs) {
    let refList = this.editorSession.getDocument().find('ref-list');
    let oldRefs = this.getReferenceIds();
    this.editorSession.transaction(tx => {
      updateEntityChildArray(tx, refList.id, 'ref', 'rid', oldRefs, newRefs);
    });
  }

  getReferenceIds() {
    let doc = this.editorSession.getDocument();
    let refs = doc.findAll('ref-list > ref');
    return refs.map(ref => ref.getAttribute('rid'))
  }

  /*
    Returns a list of formatted citations including labels
  */
  getBibliography() {
    let references = this._getReferences();
    references.sort((a,b) => {
      return a.state.pos - b.state.pos
    });
    return references
  }

  // interface for EditXrefTool
  getAvailableResources() {
    return this.getBibliography()
  }

  _getReferences() {
    const doc = this.editorSession.getDocument();
    const db = this.pubMetaDbSession.getDocument();

    let refs = doc.findAll('ref-list > ref');
    // TODO: determine order and label based on citations in the document
    return refs.map((ref) => {
      let refId = ref.getAttribute('rid');
      if (!ref.state) {
        ref.state = {};
      }
      if (!ref.state.entity) {
        ref.state.entity = db.get(refId);
      }
      return ref
    })
  }

  _getBibliographyElement() {
    return this.editorSession.getDocument().find('ref-list')
  }

}

function getLabel(node) {
  if (node && node.state) {
    return node.state.label
  }
}

function getPos(node) {
  let pos;
  if (node && node.state) {
    pos = node.state.pos;
  }
  if (pos === undefined) {
    pos = Number.MAX_VALUE;
  }
  return pos
}

/*
  Index for Xrefs.

  @example
  Lets us look up existing xrefs by target

  To get all xrefs for a given target node (e.g. fn-1)

    var xIndex = doc.xrefIndex
    xIndex.get('fn-1')
*/
class XrefIndex extends substance.DocumentIndex {

  constructor() {
    super();
    this.byTarget = new substance.TreeIndex.Arrays();
  }

  select(node) {
    return node.type === 'xref'
  }

  clear() {
    this.byTarget.clear();
  }

  // TODO: use object interface? so we can combine filters (path and type)
  get(targetId) {
    let ids = this.byTarget.get(targetId);
    // We need to return a clone, as the index may change while the result is used
    return ids ? ids.slice() : []
  }

  create(xref) {
    // const path = anno.start.path
    let targets = getXrefTargets(xref);
    targets.forEach((target) => {
      this.byTarget.add(target, xref.id);
    });
  }

  _delete(xrefId, targets) {
    targets.forEach((target) => {
      this.byTarget.remove(target, xrefId);
    });
  }

  delete(xref) {
    let targets = getXrefTargets(xref);
    this._delete(xref.id, targets);
  }

  update(node, path, newValue, oldValue) {
    if (path[2] === 'rid') {
      let targets = [];
      if (oldValue) {
        targets = oldValue.split(" ");
      }
      this._delete(node.id, targets);
      this.create(node);
    }
  }
}

/*
  Proposal for Substance 2.0 XMLEditing implementation
*/
class TextureEditing extends substance.Editing {

  // EXPERIMENTAL: run validation after pasting
  // and throw if there are errors
  // We need to find out which is the best way regarding schema
  // strictness
  // While it would be fantastic to be 100% strict all the time
  // it could also be a way to introduce an issue system
  // and instead failing badly, just make the user aware of these
  // issues
  // TODO: in general we would need to 'pre-process'
  paste(tx, content) {
    if (!content) return
    /* istanbul ignore else  */
    if (substance.isString(content)) {
      substance.paste(tx, {text: content});
    } else if (content._isDocument) {
      substance.paste(tx, { doc: content });
    } else {
      throw new Error('Illegal content for paste.')
    }

    let res = substance.validateXMLSchema(TextureArticle, tx.getDocument().toXML());
    if (!res.ok) {
      res.errors.forEach((err) => {
        console.error(err.msg, err.el);
      });
      throw new Error('Paste is violating the schema')
    }
  }

  /*
    2.0 API suggestion (pass only id, not data)
  */
  insertInlineNode(tx, node) {
    let sel = tx.selection;
    let text = "\uFEFF";
    this.insertText(tx, text);
    sel = tx.selection;
    let endOffset = tx.selection.end.offset;
    let startOffset = endOffset - text.length;
    // TODO: introduce a coordinate operation for that
    tx.set([node.id, 'start', 'path'], sel.path);
    tx.set([node.id, 'start', 'offset'], startOffset);
    tx.set([node.id, 'end', 'path'], sel.path);
    tx.set([node.id, 'end', 'offset'], endOffset);
    return node
  }


}

/*
  Proposal for Substance 2.0 XMLEditingInterface
*/
class TextureEditingInterface extends substance.EditingInterface {

  find(cssSelector) {
    return this.getDocument().find(cssSelector)
  }

  findAll(cssSelector) {
    return this.getDocument().findAll(cssSelector)
  }

  createElement(...args) {
    return this.getDocument().createElement(...args)
  }

}

class TextureDocument extends substance.XMLDocument {

  _initialize() {
    super._initialize();
    // special index for xref lookup
    this.addIndex('xrefs', new XrefIndex());
  }

  getDocTypeParams() {
    return TextureArticle.getDocTypeParams()
  }

  getXMLSchema() {
    return TextureArticle
  }

  getRootNode() {
    return this.get('article')
  }

  getXRefs() {
    let articleEl = this.get('article');
    // this traverses the article in the same way as css-select
    return articleEl.findAll('xref')
  }

  createEditingInterface() {
    return new TextureEditingInterface(this, { editing: new TextureEditing() })
  }

}

// These converters are used for the Clipboard
// Only basic formatting needs to be considered
var TextureHTMLConverters = [
  {
    type: 'p',
    tagName: 'p',
    import(el, node, converter) {
      node.content = converter.annotatedText(el, [node.id, 'content']);
    },
    export(node, el, converter) {
      el.append(converter.annotatedText([node.id, 'content']));
    }
  },
  {
    type: 'bold',
    tagName: 'b',
    matchElement(el) {
      return (el.is('b')) ||
        // To support non-semantic formatting, like GDocs does
        // ATTENTION: GDocs packs all formatting into one span using style attributes.
        // We only map to one node
        (el.is('span') && el.getStyle('font-weight') === '700')
    }
  },
  {
    type: 'italic',
    tagName: 'i',
    matchElement(el) {
      return (el.is('i')) ||
        (el.is('span') && el.getStyle('font-style') === 'italic')
    }
  },
  {
    type: 'underline',
    tagName: 'span',
    matchElement(el) {
      return el.getStyle('text-decoration') === 'underline'
    },
    export(node, el) {
      el.setStyle('text-decoration', 'underline');
    }
  },
  {
    type: 'strike',
    tagName: 'span',
    matchElement(el) {
      return el.getStyle('text-decoration') === 'line-through'
    },
    export(node, el) {
      el.setStyle('text-decoration', 'line-through');
    }
  },
  {
    type: 'sub',
    tagName: 'sub',
    matchElement(el) {
      return (el.is('sub')) || (el.is('span') && el.getStyle('vertical-align') === 'sub')
    }
  },
  {
    type: 'sup',
    tagName: 'sup',
    matchElement(el) {
      return (el.is('sup')) || (el.is('span') && el.getStyle('vertical-align') === 'super')
    },
    // export(node, el, converter) {
    //   el.tagName = 'span'
    //   el.setStyle('vertical-align', 'super')
    // }
  },
  {
    type: 'ext-link',
    tagName: 'a',
    import(el, node) {
      let href = el.getAttribute('href');
      if (href) {
        node.attributes = {
          'xlink:href': href
        };
      }
    },
    export(node, el) {
      el.setAttribute('href', node.attributes['xlink:href']);
    }
  }
];

class TextureArticleExporter extends substance.XMLExporter {

}

class TextureArticleImporter extends substance.DOMImporter {

  constructor(config, context) {
    super({
      idAttribute: 'id',
      schema: config.schema,
      // HACK: usually we use configurator.createImporter()
      converters: config.converters
    }, context);

    this.xmlSchema = TextureArticle;
  }

  importDocument(dom) {
    this.reset();
    const doc = this.state.doc;
    if (substance.isString(dom)) {
      dom = substance.DefaultDOMElement.parseXML(dom);
    }
    let articleEl = dom.find('article');
    if (!articleEl) throw new Error('Could not find <article> element.')
    doc.article = this.convertElement(articleEl);


    return this.state.doc
  }

  _initialize() {
    const schema = this.schema;
    const defaultTextType = schema.getDefaultTextType();
    const converters = this.converters;

    this._allConverters = [];
    this._propertyAnnotationConverters = [];
    this._blockConverters = [];

    for (let i = 0; i < converters.length; i++) {
      let converter;
      if (typeof converters[i] === 'function') {
        const Converter = converters[i];
        converter = new Converter();
      } else {
        converter = converters[i];
      }
      if (!converter.type) {
        throw new Error('Converter must provide the type of the associated node.')
      }
      if (!converter.matchElement && !converter.tagName) {
        throw new Error('Converter must provide a matchElement function or a tagName property.')
      }
      if (!converter.matchElement) {
        converter.matchElement = this._defaultElementMatcher.bind(converter);
      }
      const NodeClass = schema.getNodeClass(converter.type);
      if (!NodeClass) {
        throw new Error('No node type defined for converter')
      }
      if (!this._defaultBlockConverter && defaultTextType === converter.type) {
        this._defaultBlockConverter = converter;
      }

      // TODO: need to rethink this
      if (NodeClass.prototype._isAnnotation) {
        this._propertyAnnotationConverters.push(converter);
      } else {
        this._blockConverters.push(converter);
      }
    }
    if (!this._defaultBlockConverter) {
      throw new Error(`No converter for defaultTextType ${defaultTextType}`)
    }
    this._allConverters = this._blockConverters.concat(this._propertyAnnotationConverters);
  }

  _createNodeData(el, type) {
    let nodeData = super._createNodeData(el, type);
    let attributes = {};
    el.getAttributes().forEach((value, key) => {
      attributes[key] = value;
    });
    nodeData.attributes = attributes;
    return nodeData
  }

  getChildNodeIterator(el) {
    // TODO: this looks very hacky. Why do we need el plus it?
    let schema = this.xmlSchema.getElementSchema(el.tagName);
    let it = el.getChildNodeIterator();
    return new substance.ValidatingChildNodeIterator(el, it, schema.expr)
  }

  _getIdForElement(el, type) {
    if (type === 'article') {
      return 'article'
    } else {
      return super._getIdForElement(el, type)
    }
  }

  _convertPropertyAnnotation() {
    throw new Error('stand-alone annotations are not supported.')
  }

  _convertInlineNode(el, nodeData, converter) {
    const path = [];
    if (converter.import) {
      nodeData = converter.import(el, nodeData, this) || nodeData;
    }
    nodeData.start = { path, offset: 0 };
    nodeData.end = { offset: 0 };
    return nodeData
  }

}

var TextureArticlePackage = {
  name: 'TextureArticle',
  configure(config) {
    substance.registerSchema(config, TextureArticle, TextureDocument);

    config.addImporter(TextureArticle.getName(), TextureArticleImporter);
    // enable rich-text support for clipboard
    TextureHTMLConverters.forEach((converter) => {
      config.addConverter('html', converter);
    });
  }
};

function replaceWith(el, els) {
  const parent = el.parentNode;
  const next = el.nextSibling;
  els.forEach(_el => parent.insertBefore(_el, next));
  el.remove();
}

function unwrapChildren(el) {
  let parent = el.parentNode;
  let children = el.children;
  let L = children.length;
  for (let i = 0; i < L; i++) {
    parent.insertBefore(children[i], el);
  }
  parent.removeChild(el);
}

function findChild(el, cssSelector) {
  const children = el.getChildren();
  for (let i = 0; i < children.length; i++) {
    const child = children[i];
    if (child.is(cssSelector)) return child
  }
}

function findAllChilds(el, cssSelector) {
  const children = el.getChildren();
  let result = [];
  for (let i = 0; i < children.length; i++) {
    const child = children[i];
    if (child.is(cssSelector)) {
      result.push(child);
    }
  }
  return result
}


function isMixed(el) {
  let childNodes = el.childNodes;
  const L = childNodes.length;
  for (var i = 0; i < L; i++) {
    const childNode = childNodes[i];
    if (childNode.isTextNode() && !/^\s*$/.exec(childNode.textContent)) {
      return true
    }
  }
  return false
}

function printElement(el, options = {}) {
  let maxLevel = options.maxLevel || 1000;
  let res = _printElement(el, 1, maxLevel);
  return res
}

function _printElement(el, level, maxLevel) {
  let INDENT = new Array(level-1);
  INDENT.fill('  ');
  INDENT = INDENT.join('');

  if (el.isElementNode()) {
    if (level <= maxLevel) {
      let res = [];
      res.push(INDENT + _openTag(el));
      res = res.concat(
        el.childNodes.map((child) => {
          return _printElement(child, level+1, maxLevel)
        }).filter(Boolean)
      );
      res.push(INDENT + _closeTag(el));
      return res.join('\n')
    } else {
      return INDENT + _openTag(el)+'...'+_closeTag(el)
    }
  } else if (el.isTextNode()) {
    let textContent = el.textContent;
    if (/^\s*$/.exec(textContent)) {
      return ''
    } else {
      return INDENT + JSON.stringify(el.textContent)
    }
  } else {
    // TODO: render other node types and consider maxLevel
    return INDENT + el.serialize()
  }
}

function _openTag(el) {
  let attribStr = substance.DomUtils.formatAttribs(el);
  if (attribStr) {
    return `<${el.tagName} ${attribStr}>`
  } else {
    return `<${el.tagName}>`
  }
}

function _closeTag(el) {
  return `</${el.tagName}>`
}

class JATSImportDialog extends substance.Component {

  render($$) {
    const errors = this.props.errors;
    let el = $$('div').addClass('sc-jats-import-dialog');
    el.append($$('h1').addClass('se-title').text('Importing JATS'));

    Object.keys(errors).forEach((stageName) => {
      el.append($$(ImportStage, {
        stage: stageName,
        errors: errors[stageName]
      }));
    });

    return el
  }

}

class ImportStage extends substance.Component {

  render($$) {
    const errors = this.props.errors;
    let el = $$('div').addClass('sc-import-stage');
    el.append($$('h2').addClass('se-title').text(_getTitle(this.props.stage)));

    if (this.props.errors.length > 0) {
      let errorsEl = $$('div').addClass('se-errors');
      errors.forEach((err) => {
        errorsEl.append(this._renderError($$, err));
      });
      el.append(errorsEl);
    }
    return el
  }

  _renderError($$, err) {
    let el = $$('div').addClass('se-error');
    // TODO: maybe we will have more structured errors
    el.append(
      $$('div').addClass('se-message').text(err.msg)
    );
    if (err.el) {
      el.append(
        $$('pre').addClass('se-element').text(printElement(err.el, { maxLevel: 1}))
      );
    }
    return el
  }
}

