function prefillEntity(type, text) {
  let defaults = {
    type
  };
  if (type === 'person') {
    let parts = text.split(' ');
    defaults.surname = parts.pop();
    defaults.givenNames = parts.join(' ');
  } else if (type === 'organisation') {
    defaults.name = text;
  } else if (type === 'book') {
    defaults.source = text;
  } else if (type === 'journal-article') {
    defaults.articleTitle = text;
  } else if (type === 'conference-proceeding') {
    defaults.articleTitle = text;
  } else if (type === 'clinical-report') {
    defaults.articleTitle = text;
  } else if (type === 'preprint') {
    defaults.articleTitle = text;
  } else if (type === 'report') {
    defaults.source = text;
  } else if (type === 'periodical') {
    defaults.articleTitle = text;
  } else if (type === 'data-publication') {
    defaults.dataTitle = text;
  } else if (type === 'patent') {
    defaults.articleTitle = text;
  } else if (type === 'webpage') {
    defaults.title = text;
  } else if (type === 'thesis') {
    defaults.articleTitle = text;
  } else if (type === 'software') {
    defaults.title = text;
  }
  return defaults
}

function journalArticleRenderer($$, entityId, entityDb) {
  let entity = entityDb.get(entityId);
  let fragments = [];
  if (entity.authors.length > 0) {
    fragments = fragments.concat(
      _renderAuthors($$, entity.authors, entityDb),
      '.'
    );
  }
  if (entity.editors.length > 0) {
    fragments = fragments.concat(
      ' ',
      _renderAuthors($$, entity.editors, entityDb),
      '.'
    );
  }
  // We render an annotated article title here:
  if (entity.articleTitle) {
    fragments.push(
      ' ',
      _renderHTML($$, entity.articleTitle)
    );
  }

  fragments.push('. ', entity.source);
  if (entity.volume) {
    fragments.push(
      ' ',
      $$('strong').append(
        entity.volume
      )
    );
  }

  if (entity.fpage && entity.lpage) {
    fragments.push(':', entity.fpage, '-', entity.lpage);
  }

  if (entity.doi) {
    fragments.push(
      ' ',
      _renderDOI($$, entity.doi)
    );
  }
  return fragments
}

function bookRenderer($$, entityId, entityDb) {
  let entity = entityDb.get(entityId);
  let fragments = [];

  if (entity.chapterTitle) {
    fragments.push(
      _renderHTML($$, entity.chapterTitle),
      '. '
    );
  }

  if (entity.authors.length > 0) {
    fragments = fragments.concat(
      _renderAuthors($$, entity.authors, entityDb),
      '.'
    );
  }
  if (entity.editors.length > 0) {
    fragments = fragments.concat(
      ' ',
      _renderAuthors($$, entity.editors, entityDb),
      '.'
    );
  }

  if (entity.year) {
    fragments.push(' ', entity.year, '.');
  }

  if (entity.source) {
    fragments.push(' ', entity.source);
    if (entity.edition) {
      fragments.push(' (', entity.edition, ')');
    }
    fragments.push('.');
  }

  if (entity.publisherLoc && entity.publisherName) {
    fragments.push(' ', entity.publisherLoc, ': ', entity.publisherName, '.');
  }

  if (entity.doi) {
    fragments.push(
      ' ',
      _renderDOI($$, entity.doi)
    );
  }

  if (entity.fpage && entity.lpage) {
    fragments.push(
      ' pp. ',
      entity.fpage,
      '-',
      entity.lpage,
      '.'
    );
  }
  return fragments
}

