class EntitySelector extends substance.Component {

  getInitialState() {
    return {
      searchString: '',
      results: [],
      selectedIndex: -1
    }
  }

  render($$) {
    let el = $$('div').addClass('sc-entity-selector');

    let inputEl = $$('div').addClass('se-input-group').append(
      $$('input')
        .attr({
          type: 'text',
          value: this.state.searchString,
          placeholder: this.props.placeholder
        })
        .on('input', this._onSearchStringChanged)
        .on('keydown', this._onKeydown)
        .ref('searchString'),
      $$('button').addClass('se-create-dropdown').append('New')
        .on('click', this._toggleDropdown)
    );

    el.append(inputEl);

    if (this.state.dropdown) {
      let labelProvider = this.context.labelProvider;
      let menu = $$('ul').addClass('se-dropdown');
      this.props.targetTypes.forEach(targetType => {
        menu.append(
          $$('li').append(
            labelProvider.getLabel(targetType)
          ).on('click', this._createEntity.bind(this, targetType))
        );
      });
      el.append(menu);
    }

    if (this.state.searchString !== '') {
      el.append(this._renderOptions($$));
    }

    return el
  }

  _renderOptions($$) {
    let el = $$('div').addClass('se-options').ref('options');
    let db = this.context.pubMetaDbSession.getDocument();
    this.state.results.forEach((item, index) => {
      let option = $$('div').addClass('se-option').append(
        $$('span').html(
          entityRenderers[item.type](item.id, db)
        ),
        ` (${this.getLabel(item.type)})`
      );
      option.on('click', this._confirmSelected.bind(this, index));
      if (this.state.selectedIndex === index) {
        option.addClass('se-selected');
      }
      el.append(option);
      index += 1;
    });
    return el
  }

  _confirmSelected(index) {
    let item = this.state.results[index];
    this.props.onSelected(item.id);
  }

  _selectNext() {
    let selectedIndex = this.state.selectedIndex;
    let results = this.state.results;
    if (selectedIndex < results.length - 1) {
      selectedIndex += 1;
    }
    this.extendState({
      selectedIndex: selectedIndex
    });
  }

  _selectPrevious() {
    let selectedIndex = this.state.selectedIndex;
    if (selectedIndex >= 0) {
      selectedIndex -= 1;
    }
    this.extendState({
      selectedIndex: selectedIndex
    });
  }

  // TODO: For the current prorotype we use a naive regexp based filtering,
  // but we should allow full text search here
  _findEntities(searchString) {
    let db = this.context.pubMetaDbSession.getDocument();
    let availableEntities = [];
    this.props.targetTypes.forEach(targetType => {
      availableEntities = availableEntities.concat(
        db.find({ type: targetType })
      );
    });
    availableEntities = substance.without(availableEntities, ...this.props.excludes)
      .map(entityId => {
        return db.get(entityId)
      })
      .filter(entity => {
        let htmlString = entityRenderers[entity.type](entity.id, db);
        return htmlString.match(new RegExp(searchString, 'i'))
      });
    return availableEntities
  }

  _onSearchStringChanged() {
    let searchString = this.refs.searchString.val();
    let results = [];
    if (searchString) {
      results = this._findEntities(searchString);
    }

    this.setState({
      selectedIndex: -1,
      searchString: searchString,
      results
    });
  }

  _createEntity(type) {
    this.props.onCreate(type, this.state.searchString);
  }

  _toggleDropdown() {
    const isSingleType = this.props.targetTypes.length === 1;
    if(isSingleType) {
      this._createEntity(this.props.targetTypes[0]);
    } else {
      const isOpen = this.state.dropdown;
      this.extendState({dropdown: !isOpen});
    }
  }

  _onKeydown(e) {
    if (e.keyCode === 38) {
      e.preventDefault();
      this._selectPrevious();
    } else if (e.keyCode === 40) {
      e.preventDefault();
      this._selectNext();
    } else if (e.keyCode === 13 && this.state.selectedIndex >= 0) {
      this._confirmSelected(this.state.selectedIndex);
    }
  }
}

/*
  Used to edit relationhips to other entities.

  On confirmation emits a change event carrying the property name and
  an array of entity ids.
*/
class EditRelationship extends substance.Component {
  getInitialState() {
    // We want to keep state in a plain old JS object while editing
    return {
      mode: undefined,
      modeProps: undefined,
      entityIds: this.props.entityIds || []
    }
  }

  didMount() {
    this.handleActions({
      'closeModal': this._closeModal,
      'created': this._onAddNew
    });
  }

  render($$) {
    let el = $$('div').addClass('sc-edit-relationship');
    let db = this.context.pubMetaDbSession.getDocument();
    let mode = this.state.mode;

    if (mode) {
      let ModeComponent;
      if (mode === 'edit') {
        ModeComponent = EditEntity;
      } else {
        ModeComponent = CreateEntity;
      }

      el.append(
        $$(ModalDialog, {
          transparent: true
        }).append(
          $$(ModeComponent, this.state.modeProps)
        )
      );
    } else {
      let contentEl = $$('div').addClass('se-content');
      contentEl.append(
        $$(FormTitle, {
          name: 'edit-'+this.props.propertyName
        })
      );
      if (this.state.entityIds.length > 0) {
        let tableEl = $$('table').addClass('se-entries');
        this.state.entityIds.forEach((entityId) => {
          let node = db.get(entityId);
          tableEl.append(
            $$('tr').addClass('se-entry').append(
              $$('td').addClass('se-handle').append(
                $$(substance.FontAwesomeIcon, {icon: 'fa-reorder'}).addClass('se-icon')
              )
              .on('mousedown', this._activateRowDrag.bind(this, entityId)),
              $$('td').addClass('se-name').html(
                entityRenderers[node.type](node.id, db)
              ),
              $$('td').addClass('se-type').append(
                $$('span').append(this.context.labelProvider.getLabel(node.type))
              ),
              $$('td').addClass('se-actions').append(
                $$('button').append('Edit').on('click', this._onEdit.bind(this, entityId)),
                $$('button').append('Delete').on('click', this._onDelete.bind(this, entityId))
              )
            ).ref(entityId)
            .on('dragend', this._onDragend.bind(this, entityId))
            .on('dragover', this._onDragOver.bind(this, entityId))
            .on('dragleave', this._onDragLeave.bind(this, entityId))
            .on('dragstart', this._onDrag)
            .on('dragenter', this._onDrag)
          );
        });
        contentEl.append(tableEl);
      } else {
        contentEl.append(
          $$('div').addClass('se-empty').append('No Entries')
        );
      }
      contentEl.append(
        $$(EntitySelector, {
          placeholder: 'Type to add new ...',
          targetTypes: this.props.targetTypes,
          showCreateDialog: true,
          excludes: this.state.entityIds,
          limit: 50,
          onSelected: this._onAddNew.bind(this),
          onCreate: this._onCreate.bind(this),
        })
      );
      el.append(
        contentEl,
        $$('div').addClass('sg-actions').append(
          $$('button')
            .addClass('sc-button sm-style-big')
            .append('Save')
            .on('click', this._save),
          $$('button')
            .addClass('sc-button sm-style-big sm-secondary')
            .append('Cancel')
            .on('click', this._cancel)
        )
      );
    }
    return el
  }

  _onCreate(targetType, text) {
    let defaults = {};
    if (!substance.isNil(text)) {
      defaults = prefillEntity(targetType, text);
    }
    this.extendState({
      mode: 'create',
      modeProps: {
        type: targetType,
        defaults: defaults
      }
    });
  }

  _onEdit(entityId) {
    let db = this.context.pubMetaDbSession.getDocument();
    let node = db.get(entityId);
    this.extendState({
      mode: 'edit',
      modeProps: {
        node
      }
    });
  }

  _onReorder(entityId, target) {
    let entityIds = this.state.entityIds;
    const currentPos = entityIds.indexOf(entityId);
    const targetPos = entityIds.indexOf(target);
    entityIds[currentPos] = target;
    entityIds[targetPos] = entityId;
    this.extendState({entityIds: entityIds});
  }

  _onAddNew(entityId) {
    let entityIds = this.state.entityIds.concat([ entityId ]);
    this.extendState({
      entityIds: entityIds,
      mode: undefined,
      modeProps: undefined
    });
  }

  _onDelete(entityId) {
    let entityIds = substance.without(this.state.entityIds, entityId);
    this.extendState({
      entityIds: entityIds
    });
  }

  _save() {
    this.send('entitiesSelected', this.state.entityIds);
  }

  _cancel() {
    this.send('closeModal');
  }

  _closeModal() {
    this.extendState({
      mode: undefined,
      modeProps: undefined
    });
  }

  _activateRowDrag(entityId) {
    let rowEl = this.refs[entityId];
    rowEl.attr('draggable', true);
  }

  _deactivateRowDrag(entityId) {
    let rowEl = this.refs[entityId];
    rowEl.attr('draggable', false);
  }

  _onDragend(entityId) {
    this._deactivateRowDrag(entityId);
    this._onReorder(entityId, this.currentTarget);
    this.currentTarget = null;
    this.currentVisualTarget = null;
  }

  _onDragOver(entityId) {
    if(this.currentVisualTarget !== entityId) {
      this.currentTarget = entityId;
      this.currentVisualTarget = entityId;
      let rowEl = this.refs[entityId];
      rowEl.addClass('sm-drop');
    }
  }

  _onDragLeave(entityId) {
    this.currentVisualTarget = null;
    let rowEl = this.refs[entityId];
    rowEl.removeClass('sm-drop');
  }

  _onDrag(e) {
    // Stop event propagation for the dragstart and dragenter
    // events, to avoid editor drag manager errors
    e.stopPropagation();
  }
}

/*
  Input that manages a list of entityIds, as needed for a multi-target
  relationship between entities
*/
class RelationshipInput extends substance.Component {

  getInitialState() {
    return {
      entityIds: this.props.entityIds,
      edit: false
    }
  }

  didMount() {
    this.handleActions({
      'cancel': this._onCancel,
      'entitiesSelected': this._onEntitiesSelected,
      'closeModal': this._onCancel,
    });
  }

  render($$) {
    let el = $$('div').addClass('sc-relationship-input');
    let entities = this.state.entityIds;
    let db = this.context.pubMetaDbSession.getDocument();

    if (this.state.edit) {
      el.append(
        $$(ModalDialog, {
          transparent: true
        }).append(
          $$(EditRelationship, {
            propertyName: this.props.propertyName,
            entityIds: this.state.entityIds,
            targetTypes: this.props.targetTypes
          })
        )
      );
    }
    if (entities.length > 0) {
      entities.forEach((entityId, index) => {
        let entity = db.get(entityId);
        el.append(
          $$('span').html(
            entityRenderers[entity.type](entity.id, db)
          )
        );
        if (index < entities.length-1) {
          el.append('; ');
        }
      });
    } else {
      el.append(
        $$('div').addClass('se-empty').append('No Entries')
      );
    }

    el.append(
      $$('button').append('Edit').on('click', this._openRelationshipEditor)
    );

    return el
  }

  _onEntitiesSelected(entityIds) {
    this.setState({
      entityIds,
      edit: false
    });
  }

  _onCancel() {
    this.extendState({
      edit: false
    });
  }

  _openRelationshipEditor() {
    this.extendState({
      edit: true
    });
  }

  getValue() {
    return this.state.entityIds
  }

}

