var RichTextInputPackage = {
  name: 'rich-text-input',
  configure: function(config) {
    config.defineSchema({
      name: 'rich-text-input',
      DocumentClass: substance.Document,
      version: '1.0.0'
    });

    config.import(substance.BasePackage);

    // Body
    config.addNode(Body);
    config.addConverter('html', {
      type: 'body',
      tagName: 'body',
      import: function(el, node, converter) {
        node.id = 'body';
        node.content = converter.annotatedText(el, [node.id, 'content']);
      },
      export: function(node, el, converter) {
        el.append(converter.annotatedText([node.id, 'content']));
      }
    });

    // Emphasis
    config.addNode(Emphasis);
    config.addConverter('html', {
      type: 'emphasis',
      tagName: 'em'
    });
    config.addComponent('emphasis', EmphasisComponent);
    config.addCommand('emphasis', substance.AnnotationCommand, {
      nodeType: 'emphasis',
      commandGroup: 'annotations'
    });
    config.addIcon('emphasis', { 'fontawesome': 'fa-italic' });
    config.addLabel('emphasis', 'Emphasis');

    // Strong
    config.addNode(Strong);
    config.addConverter('html', {
      type: 'strong',
      tagName: 'strong'
    });
    config.addComponent('strong', StrongComponent);
    config.addCommand('strong', substance.AnnotationCommand, {
      nodeType: 'strong',
      commandGroup: 'annotations'
    });
    config.addIcon('strong', { 'fontawesome': 'fa-bold' });
    config.addLabel('strong', 'Strong');

    // Subscript
    config.addNode(Subscript);
    config.addConverter('html', {
      type: 'subscript',
      tagName: 'sub'
    });
    config.addComponent('subscript', SubscriptComponent);
    config.addCommand('subscript', substance.AnnotationCommand, {
      nodeType: 'subscript',
      commandGroup: 'annotations'
    });
    config.addIcon('subscript', { 'fontawesome': 'fa-subscript' });
    config.addLabel('subscript', 'Subscript');

    // Superscript
    config.addNode(Superscript);
    config.addConverter('html', {
      type: 'superscript',
      tagName: 'sup'
    });
    config.addComponent('superscript', SuperscriptComponent);
    config.addCommand('superscript', substance.AnnotationCommand, {
      nodeType: 'superscript',
      commandGroup: 'annotations'
    });
    config.addIcon('superscript', { 'fontawesome': 'fa-superscript' });
    config.addLabel('superscript', 'Superscript');

    // Keyboard shortcuts
    config.addKeyboardShortcut('CommandOrControl+B', { command: 'strong' });
    config.addKeyboardShortcut('CommandOrControl+I', { command: 'emphasis' });

    config.addImporter('html', RichTextInputImporter);
    config.addExporter('html', RichTextInputExporter);

    config.addToolPanel('main-overlay', [
      {
        name: 'annotations',
        type: 'tool-group',
        showDisabled: false,
        commandGroups: ['annotations']
      }
    ]);
  }
};

class RichTextInput extends substance.Component {
  constructor(...args) {
    super(...args);
    this.cfg = new substance.Configurator().import(RichTextInputPackage);
    this._initDoc(this.props);
  }

  _initDoc(props) {
    this.importer = this.cfg.createImporter('html');
    this.doc = this.importer.importDocument(props.value);
    this.editorSession = new substance.EditorSession(this.doc, {
      id: this.props.editorId,
      configurator: this.cfg
    });
  }

  render($$) {
    let el = $$('div').addClass('sc-rich-text-input');
    el.append(
      $$(RichTextEditor, {
        editorSession: this.editorSession,
        editorId: this.props.editorId
      }).ref('editor')
    );
    return el
  }

  getValue() {
    let htmlExporter = this.cfg.createExporter('html');
    let result = htmlExporter.exportDocument(this.doc);
    return result
  }
}


